import NavBar from './NavBar';


export default function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <NavBar className="navBar"/>
      <Routes>
        <Route exact path="/" element={<Home/>}/>
        <Route exact path="/About" element={<About/>}/>
        <Route exact path="/LoginPage" element={<LoginPage/>}/>
